import React from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { Navbar, Nav, Container, NavDropdown } from 'react-bootstrap';
import { LinkContainer } from 'react-router-bootstrap';
import { logout } from '../actions/userActions';
import { useHistory } from 'react-router-dom';
import SearchBarForProducts from './SearchBarForProducts';

function NavBar() {
  let history = useHistory();
  const dispatch = useDispatch();

  // login reducer
  const userLoginReducer = useSelector((state) => state.userLoginReducer);
  const { userInfo } = userLoginReducer;

  // logout
  const logoutHandler = () => {
    dispatch(logout()); // action
    history.push('/login');
    window.location.reload();
  };

  return (
    <header>
      <Navbar bg="dark" variant="dark" expand="lg" collapseOnSelect>
        <Container>
          {/* Logo / Home */}
          <LinkContainer to="/">
            <Navbar.Brand>
              <i className="fas fa-home"></i> Home
            </Navbar.Brand>
          </LinkContainer>

          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
              {/* All Products with filters */}
              <NavDropdown title="All Products" id="all-products-dropdown">
                <LinkContainer to="/products">
                  <NavDropdown.Item>All</NavDropdown.Item>
                </LinkContainer>
                <NavDropdown.Divider />
                <LinkContainer to="/products?type=face">
                  <NavDropdown.Item>Face</NavDropdown.Item>
                </LinkContainer>
                <LinkContainer to="/products?type=lips">
                  <NavDropdown.Item>Lips</NavDropdown.Item>
                </LinkContainer>
                <LinkContainer to="/products?type=eyes">
                  <NavDropdown.Item>Eyes</NavDropdown.Item>
                </LinkContainer>
                <LinkContainer to="/products?type=eyebrow">
                  <NavDropdown.Item>Eyebrow</NavDropdown.Item>
                </LinkContainer>
                <LinkContainer to="/products?type=hair">
                  <NavDropdown.Item>Hair</NavDropdown.Item>
                </LinkContainer>
              </NavDropdown>

              {/* New Product (Admins Only) */}
              {userInfo && userInfo.admin && (
                <LinkContainer to="/new-product/">
                  <Nav.Link>Add Product</Nav.Link>
                </LinkContainer>
              )}

              {/* Search Bar */}
              <span className="ml-3">
                <SearchBarForProducts />
              </span>
            </Nav>

            {/* login-logout condition here */}
            {userInfo ? (
              <NavDropdown
                className="text-capitalize"
                title={userInfo.username}
                id="username"
              >
                <LinkContainer to="/account">
                  <NavDropdown.Item>Account Settings</NavDropdown.Item>
                </LinkContainer>
                <LinkContainer to="/all-addresses/">
                  <NavDropdown.Item>Address Settings</NavDropdown.Item>
                </LinkContainer>
                <LinkContainer to="/stripe-card-details/">
                  <NavDropdown.Item>Card Settings</NavDropdown.Item>
                </LinkContainer>
                <LinkContainer to="/all-orders/">
                  <NavDropdown.Item>All Orders</NavDropdown.Item>
                </LinkContainer>
                <NavDropdown.Item onClick={logoutHandler}>
                  Logout
                </NavDropdown.Item>
              </NavDropdown>
            ) : (
              <LinkContainer to="/login">
                <Nav.Link>
                  <i className="fas fa-user"></i> Login
                </Nav.Link>
              </LinkContainer>
            )}
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </header>
  );
}

export default NavBar;
